import React from 'react';

class PersonalData extends React.Component {
  render() {
    const brazilStates = ["AC", "AL", "AM", "AP", "BA", "CE", "DF", "ES", "GO", "MA", "MT", "MS", "MG", "PA", "PB", "PR", "PE", "PI", "RJ", "RN", "RO", "RS", "RR", "SC", "SE", "SP", "TO"];

    return (
      <fieldset>
        <label> Nome
          <input type="text" name="nome" maxLength="40" required />
        </label>

        <label> E-mail
          <input type="email" name="email" maxLength="50" required />
        </label>

        <label> CPF
          <input type="text" name="cpf" maxLength="11" required />
        </label>

        <label> Endere√ßo
          <input type="text" name="adress" maxLength="200" required />
        </label>

        <label> Cidade
          <input type="text" name="city" maxLength="28" required />
        </label>

        <label> Estado
          <select>
            {brazilStates.map(element => {
              return <option value={element}> {element} </option>
            })};
          </select>
        </label>

        <label>
            <input type="radio" name="moradia" value="casa"/> Casa
            <input type="radio" name="moradia" value="apartamento" /> Apartamento
        </label>

      </fieldset>
    )
  }
}

export default PersonalData;
